import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Layout = createReactComponent("Layout", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}], ["line", {
  x1: "3",
  y1: "9",
  x2: "21",
  y2: "9",
  key: "1chj20"
}], ["line", {
  x1: "9",
  y1: "21",
  x2: "9",
  y2: "9",
  key: "1es4cq"
}]]]);
export default Layout;
